script: |
  super -f text -I q6439.spq | sort > q6439.out

inputs:
  - name: q6439.spq
    data: |
      SELECT DISTINCT + 65 AS col2, - col0 + - + col0 / + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q6439.out
    data: |
      65	-16
      65	-88
      65	-98
